import React from 'react';
import './AdminNavbar.css';

const Navbar = () => {
    return (
        <nav className="admin-navbar">
            <div>Admin</div>
            <div className="logo">
                <h1>Cinema Movies</h1>
            </div>
        </nav>
    );
};

export default Navbar;
